import { NavLink } from "react-router-dom";
import "./Navigate.css";

function Navigate(): JSX.Element {
    return (
        <div className="Navigate">
            <NavLink className={'text-decoration-none'} to={"BarMitzvah"}>בר מצווה</NavLink>
            <NavLink className={'text-decoration-none'} to={"BatMitzvah"}>בת מצווה</NavLink>
            <NavLink className={'text-decoration-none'} to={"OneYearOld"}>גיל שנה</NavLink>
            <NavLink className={'text-decoration-none'} to={"Family"}>משפחה</NavLink>
            <NavLink className={'text-decoration-none'} to={"Pregnancy"}>הריון</NavLink>
            <NavLink className={'text-decoration-none'} to={"image"}>תדמית</NavLink>
            <NavLink className={'text-decoration-none'} to={"studio"}>סטודיו</NavLink>
            <NavLink className={'text-decoration-none'} to={"bar-mitzvah"}>מחירון</NavLink>
            <NavLink className={'text-decoration-none'} to={"bar-mitzvah"}>מאמרים</NavLink>
            <NavLink className={'text-decoration-none'} to={"bar-mitzvah"}>צור קשר</NavLink>
        </div>
    );
}

export default Navigate;
